__NUXT_JSONP__("/svet/region/ligurie", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v){return {data:[{place:[{id:70,id_state:h,id_image_cover:a,id_image_hero:a,created_at:"2024-01-19T18:29:30.798578+00:00",slug:"ligurie",name:"Ligurie",information_chatgpt:"\u003Cp\u003ELigurie, nádherný kousek Středomoří, zaujímá své místo na západním pobřeží Itálie a láká návštěvníky svou malebnou krajinou, bohatou historií a kulinářskými lahůdkami. Tento region, který se táhne podél Tyrhénského moře a Ligurských Alp, je známý svými krásnými pobřežními městy, pestrou kulturou a vynikajícími gastronomickými zážitky.\u003C\u002Fp\u003E\n\u003Cp\u003EJedním z nejvýraznějších prvků Ligurie jsou její pobřežní vesnice a města, která lákají návštěvníky svou malebnou atmosférou. Monterosso, Vernazza, Corniglia, Manarola a Riomaggiore, společně známá jako Cinque Terre, jsou bezpochyby perly Ligurského pobřeží. Tyto barvité vesnice se tyčí na útesech nad mořem a nabízejí nádherné výhledy na azurové vody. Procházky po úzkých uličkách, plné historických domů a tradičních obchodů s řemeslnými výrobky, jsou nezapomenutelným zážitkem.\u003C\u002Fp\u003E\n\u003Cp\u003ESamotné hlavní město Ligurie, Janov, je dalším fascinujícím místem, které nabízí bohatý kulturní dědictví. Historické centrum města, zapsané na seznamu světového dědictví UNESCO, je plné gotických paláců, kostelů a úzkých uliček. Významnou památkou je zde i akvárium, jedno z největších v Evropě, které představuje bohatství mořského života v Ligurském moři.\u003C\u002Fp\u003E\n\u003Cp\u003EPro milovníky přírody a dobrodružství nabízí Ligurie nejen krásné pláže, ale i horské oblasti, které lákají turisty svou divokou krásou. Národní park Cinque Terre a Portofino jsou ideálními místy pro pěší túry a pozorování přírody. Zdejší kopcovitý terén poskytuje úžasné výhledy na pobřeží i vnitrozemí, ať už se rozhodnete pro pěší výlety nebo horskou cyklistiku.\u003C\u002Fp\u003E\n\u003Cp\u003EGastronomie Ligurie je dalším lákadlem, které si nenecháte ujít. Oblíbeným místním pokrmem je pesto, omáčka připravovaná ze sušených rajčat, bazalky, piniových ořechů, parmazánu a olivového oleje. V kombinaci s čerstvě uvařenými těstovinami tvoří lahodnou pochoutku pro chuťové buňky. Ligurie je také známá svými rybími specialitami, ať už si dáte předkrm v podobě chobotnicové saláty nebo hlavní chod ve formě svěže ulovených ryb.\u003C\u002Fp\u003E\n\u003Cp\u003EPokud hledáte autentický kulturní zážitek, doporučujeme navštívit tradiční vesnice v horách, kde se místní lidé drží starých tradic a zachovávají historickou atmosféru. Tyto vesnice, s kamenitými domy a malebnými náměstíčky, vám umožní ponořit se do autentické ligurské kultury a pochopit místní způsob života.\u003C\u002Fp\u003E\n\u003Cp\u003ELigurie je rovněž známá svými slavnými festivaly a událostmi, které přinášejí do regionu ještě větší barevnost a radost. Mezi tyto události patří například Festa della Stella Maris, slavnost věnovaná ochrance moře, nebo historické slavnosti v janovském starém přístavu.\u003C\u002Fp\u003E\n\u003Cp\u003ECelkově vzato, Ligurie je jedinečný italský region, který spojuje krásu přírody, bohatou historii a vynikající kulinářské zážitky. Bez ohledu na to, zda se rozhodnete prozkoumat malebná pobřežní města, vychutnat si horské túry nebo ochutnat místní speciality, Ligurie vám nabídne nezapomenutelné zážitky a pohodovou atmosféru Středomoří.\u003C\u002Fp\u003E",type_place:"region",coordinates:[{latitude:44.455247,longitude:8.76652}],zoom:[{google:8,booking:10}],affiliate:[{name:i,value:d}],information_author:[],seo_tags:[{tag:j}],name_original:"Liguria",updated_at:"2024-03-04T19:48:21.881586+00:00",type_region:[{type:"Region"}],setting_top:d,setting_status_public:e}],imagePlace:[],placeState:[{tld:".it",name:j,area:301338,population:60367475,slug:k,id_continent:f,information_chatgpt:"\u003Cp\u003EItálie, oficiálně známá jako Italská republika, se nachází v jižní Evropě a je známá svou bohatou historií, kulturou, uměním, módním průmyslem a gastronomií. S rozlohou 301 000 km² je Itálie čtvrtou největší zemí v Evropě a má populaci přes 60 milionů lidí.\u003C\u002Fp\u003E\n\u003Cp\u003EItálie je domovem několika významných historických civilizací, včetně Římské říše, což ji činí důležitým střediskem umění a architektury. Mezi nejvýznamnější památky patří Koloseum, Vatikán a Florencie s největší galerií umění na světě - Uffizi.\u003C\u002Fp\u003E\n\u003Cp\u003EItalská kuchyně je také velmi oblíbená po celém světě a nabízí širokou škálu chutí a pokrmů, včetně pizza, těstovin, zmrzliny a kávy. Itálie je také známá svým vinařstvím a produkuje mnoho známých vín, jako je například Chianti, Barolo nebo Brunello di Montalcino.\u003C\u002Fp\u003E\n\u003Cp\u003EItálie má také velmi rozmanitou přírodu a krajiny. Na jihu země jsou známé nádherné pláže, jako jsou ty na Sicílii nebo v Apulii. Na severu jsou pak nejvyšší vrcholy Alp, včetně Mont Blancu. Mezi nejnavštěvovanější přírodní krásy patří jezera Como, Garda a Maggiore.\u003C\u002Fp\u003E\n\u003Cp\u003EItálie je známá také svým módním průmyslem, který se soustředí zejména v Miláně. Milánský Týden módy patří k největším na světě a je to také důležitá příležitost pro italské návrháře prezentovat své nové kolekce.\u003C\u002Fp\u003E\n\u003Cp\u003EItálie má také velmi dobré dopravní spojení, díky čemuž je snadné cestovat po zemi vlakem, autobusem nebo autem. Mezi nejpopulárnější turistické destinace patří Řím, Florencie, Benátky, Milán a Neapol.\u003C\u002Fp\u003E",money_prices:[{name:"Taxi (cena za km)",value:l,date_update:c},{name:"Hlavní jídlo",value:15,date_update:c},{name:"Chleba",value:m,date_update:c},{name:"Mléko",value:1.2,date_update:c},{name:"Voda (500ml)",value:e,date_update:c},{name:"Espresso",value:e,date_update:c},{name:"Zmrzlina (jeden kopeček)",value:m,date_update:c},{name:"Pivo",value:f,date_update:c},{name:"Krabička cigaret",value:a,date_update:c},{name:"Bic Mac",value:4.5,date_update:c},{name:"Coca Cola (500ml)",value:l,date_update:c}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:b},{name:"Policie",value:"113",date_update:b},{name:"Hasiči",value:"115",date_update:b},{name:"Zdravotnická záchranná služba",value:n,date_update:b},{name:"Turistická policie",value:"06 441011",date_update:b},{name:"Horská záchranná služba",value:n,date_update:b},{name:"Pobřežní záchranná služba",value:"1530",date_update:b}],phone_prefix:"+39",coordinates:[{latitude:"41.8719",longitude:"12.5674"}],people_religion:[{name:"Římskokatolické křesťanství",value:"73.8%"},{name:"Bez vyznání",value:"21.8%"},{name:"Muslimové",value:"4.1%"},{name:"Jiná náboženství",value:o}],people_nationality:[{name:"Italové",value:"91%"},{name:"Sicilané",value:"5%"},{name:"Sardinci",value:"0.9%"},{name:"Albánci",value:"0.6%"},{name:"Tunisané",value:"0.4%"},{name:"Romové",value:o},{name:"Ostatní",value:"1.8%"}],visitors_entry:[{name:"Občanský průkaz",value:"Pro občany Evropské unie je pro vstup do Itálie postačující občanský průkaz. Není tedy potřeba mít cestovní pas.",date_update:p},{name:"Cestovní pas",value:"Pro vstup do Guernsey není pro občany Evropské unie vyžadován cestovní pas.",date_update:p},{name:"Vízum",value:"Občané České republiky, která je členem Evropské unie a Schengenského prostoru, nemusí mít pro krátkodobý pobyt v Itálii vízum. Pro delší pobyty nebo pracovní cesty však mohou být vyžadována další povolení a víza. Pro osoby z jiných zemí mimo EU nebo Schengenského prostoru může být pro vstup do Itálie potřebné vízum.",date_update:b},{name:"Očkování",value:"Pro vstup do Itálie není momentálně vyžadováno očkování proti COVID-19, ale doporučuje se mít potvrzení o očkování nebo o negativním testu na COVID-19. Při překračování hranic je možné, že budou vyžadována různá omezení a pravidla v závislosti na aktuální situaci s COVID-19.",date_update:b},{name:"Cestovní pojištění",value:"Pro vstup do Itálie není nutné mít cestovní ani zdravotní pojištění. Nicméně se doporučuje mít cestovní pojištění, které může pokrýt lékařské výlohy a ztrátu zavazadel.",date_update:b},{name:"Bezpečnostní situace",value:"Itálie je obecně považována za bezpečnou zemi, avšak doporučuje se být obezřetný v přeplněných turistických oblastech, zejména v centru Říma a Florencie, kde se vyskytují kapsáři. Dále se nedoporučuje cestovat do oblasti Neapolska v noci a mimo turistické trasy. Pokud máte nějaké obavy ohledně bezpečnosti, můžete se obrátit na místní turistické informační centrum nebo konzulát.",date_update:b},{name:"Další informace",value:"V Itálii se používá euro. Místním zvyklostem je například, že se na veřejnosti neobléká krátce a přikrývají se ramena při návštěvě kostelů. V restauracích se zpravidla nevydává samostatný účet pro každého hosta, ale účet se rozdělí podle počtu osob u stolu. Dále se doporučuje být opatrný při řízení auta v Itálii, zejména v říjnu a listopadu, kdy probíhá sběr oliv a může docházet k pádům oliv na silnice.",date_update:b}],type_place:q,id_image_cover:g,id_image_hero:g,id_city_main:1068,affiliate:[{name:i,value:d}],mpz:"IT",alerts:a,zoom:[{google:5,booking:6}],ids_neighboring_countries:[{id:75},{id:43},{id:12},{id:200},{id:204},{id:236}],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:h,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2024-03-04T19:48:12.84066+00:00",name_original:a,currency:[{code:"EUR",name:"euro"}],setting_top:d,setting_status_public:e}],imagePlaceState:[{id:g,name:k,source:"\u002Fworld\u002Fstates\u002F",type:q,author:"pixabay.com",created_at:"2023-05-03T20:14:00.749527+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:f,slug:"evropa",name:"Evropa",area:10180000,population:746000000,population_density:73.22,number_states:44,information_chatgpt:"\u003Cp\u003EEvropa je druhým nejmenším kontinentem na světě, ale zároveň se jedná o jednu z nejvíce rozmanitých oblastí na planetě. Nachází se zde mnoho historických a kulturních památek, překrásných přírodních scenérií a mnoho dalších atrakcí, což z ní dělá jednu z nejnavštěvovanějších turistických destinací na světě.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa má dlouhou a bohatou historii. Na kontinentě se odehrály mnohé důležité události, jako například římská říše, středověké křížové výpravy, renesance, průmyslová revoluce a dvě světové války. Tato historie se odráží v architektuře, muzeích a dalších kulturních památkách, které jsou na kontinentu k vidění.\u003C\u002Fp\u003E\n\u003Cp\u003EV Evropě se nachází mnoho zajímavých měst. Například Paříž, Londýn, Řím, Barcelona, Praha, Berlín a Amsterdam jsou velmi oblíbenými cíli turistů. Tyto města nabízejí nejen historické památky, ale také vynikající kuchyni, noční život a mnoho možností pro nákupy.\u003C\u002Fp\u003E\n\u003Cp\u003EPřírodní krása Evropy je také úžasná. Nachází se zde krásné pláže, hory, řeky a jezera. Alpské hory nabízejí překrásné scenérie, skvělé podmínky pro lyžování a další outdoorové aktivity. Národní parky, jako třeba Plitvická jezera v Chorvatsku, Krkonošský národní park v České republice nebo Národní park Durmitor v Černé Hoře, jsou dalšími příklady nádherných přírodních scenérií, které stojí za návštěvu.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa také nabízí širokou škálu kulturních aktivit. Existují zde mnohé umělecké festivaly, výstavy, divadelní představení a koncerty, které jsou pořádány po celém kontinentu. Mnoho měst také pořádá tradiční slavnosti a jarmarky, kde se můžete seznámit s místními tradicemi a kulturou.\u003C\u002Fp\u003E\n\u003Cp\u003EPři návštěvě Evropy si určitě nenechte ujít místní kuchyni. Každá země má své vlastní speciality a chuťě\u003C\u002Fp\u003E\u003Cp\u003EMezi nejznámější evropské kuchyně patří italská, francouzská a španělská. Italská kuchyně je známá svými těstovinami, pizzou a zmrzlinou. Francouzská kuchyně nabízí širokou škálu různých pokrmů, jako například sýry, pečivo, maso a víno. Španělská kuchyně je známá svými tapas, paellou a sangriou. Kromě těchto kuchyní jsou v Evropě také velmi oblíbené pokrmy jako německé klobásy, anglické snídaně, holandský sýr a mnoho dalšího.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa také nabízí mnoho možností pro sportovní aktivity. Mezi nejpopulárnější sporty patří fotbal, hokej, tenis a cyklistika. Na kontinentu se také nachází mnoho golfových hřišť, lyžařských středisek a dalších sportovních zařízení. V posledních letech se stále více lidí zajímá o ekoturistiku, a tak se nabízí možnost podniknout pěší túru nebo cyklistický výlet a objevovat krásy evropské přírody.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa je jedním z nejlepších míst pro cestování, nabízí mnoho možností pro každého cestovatele. Díky rozmanitosti kontinentu si každý najde to svoje, co ho zaujme. Záleží pouze na vás, zda si zvolíte kulturní zážitky, přírodní krásy, sportovní aktivity nebo si jen tak užijete místní kuchyni a pohodu.\u003C\u002Fp\u003E",coordinates:[{latitude:47.497912,longitude:19.040235}],type_place:"continent",id_image_cover:f,id_image_hero:f,zoom:[{google:r,booking:r}],information_author:[{text:"\u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E je druhým nejmenším kontinentem na světě, ale zároveň se jedná o jednu z nejvíce rozmanitých oblastí na planetě. Nachází se zde mnoho historických a kulturních památek, překrásných přírodních scenérií a mnoho dalších atrakcí, což z ní dělá jednu z nejnavštěvovanějších turistických destinací na světě.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E má dlouhou a bohatou historii. Na kontinentě se odehrály mnohé důležité události, jako například římská říše, středověké křížové výpravy, renesance, průmyslová revoluce a dvě světové války. Tato historie se odráží v architektuře, muzeích a dalších kulturních památkách, které jsou na kontinentu k vidění.\u003C\u002Fp\u003E\n\u003Cp\u003EV \u003Cb\u003EEvropě\u003C\u002Fb\u003E se nachází mnoho zajímavých měst. Například \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fpariz\"\u003EPaříž\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Flondyn\"\u003ELondýn\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Frim\"\u003EŘím\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbarcelona\"\u003EBarcelona\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fpraha\"\u003EPraha\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fberlin\"\u003EBerlín\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Famsterdam\"\u003EAmsterdam\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou velmi oblíbenými cíli turistů. Tyto města nabízejí nejen historické památky, ale také vynikající kuchyni, noční život a mnoho možností pro nákupy.\u003C\u002Fp\u003E\n\u003Cp\u003EPřírodní krása \u003Cb\u003EEvropy\u003C\u002Fb\u003E je také úžasná. Nachází se zde krásné pláže, hory, řeky a jezera. \u003Cb\u003EAlpské hory\u003C\u002Fb\u003E nabízejí překrásné scenérie, skvělé podmínky pro lyžování a další outdoorové aktivity. Národní parky, jako třeba \u003Cb\u003EPlitvická jezera\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fchorvatsko\"\u003EChorvatsku\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003EKrkonošský národní park\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fcesko\"\u003EČeské republice\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ENárodní park Durmitor\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fcerna-hora\"\u003EČerné Hoře\u003C\u002Fa\u003E\u003C\u002Fb\u003E, jsou dalšími příklady nádherných přírodních scenérií, které stojí za návštěvu.\u003C\u002Fp\u003E\n  \u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E také nabízí širokou škálu kulturních aktivit. Existují zde mnohé umělecké festivaly, výstavy, divadelní představení a koncerty, které jsou pořádány po celém kontinentu. Mnoho měst také pořádá tradiční slavnosti a jarmarky, kde se můžete seznámit s místními tradicemi a kulturou.\u003C\u002Fp\u003E\n  \u003Cp\u003EPři návštěvě \u003Cb\u003EEvropy\u003C\u002Fb\u003E si určitě nenechte ujít místní kuchyni. Každá země má své vlastní speciality a chuťě\u003C\u002Fp\u003E\u003Cp\u003EMezi nejznámější evropské kuchyně patří \u003Cb\u003Eitalská\u003C\u002Fb\u003E, \u003Cb\u003Efrancouzská\u003C\u002Fb\u003E a \u003Cb\u003Ešpanělská\u003C\u002Fb\u003E. \u003Cb\u003EItalská kuchyně\u003C\u002Fb\u003E je známá svými \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fpasta\"\u003Etěstovinami\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fpizza\"\u003Epizzou\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003Ezmrzlinou\u003C\u002Fb\u003E. \u003Cb\u003EFrancouzská kuchyně\u003C\u002Fb\u003E nabízí širokou škálu různých pokrmů, jako například sýry, pečivo, maso a víno. \u003Cb\u003EŠpanělská kuchyně\u003C\u002Fb\u003E je známá svými \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Ftapas\"\u003Etapas\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fpaella\"\u003Epaellou\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003Esangriou\u003C\u002Fb\u003E. Kromě těchto kuchyní jsou v \u003Cb\u003EEvropě\u003C\u002Fb\u003E také velmi oblíbené pokrmy jako \u003Cb\u003Eněmecké klobásy\u003C\u002Fb\u003E, \u003Cb\u003Eanglické snídaně\u003C\u002Fb\u003E, \u003Cb\u003Eholandský sýr\u003C\u002Fb\u003E a mnoho dalšího.\u003C\u002Fp\u003E\n  \u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E také nabízí mnoho možností pro sportovní aktivity. Mezi nejpopulárnější sporty patří fotbal, hokej, tenis a cyklistika. Na kontinentu se také nachází mnoho golfových hřišť, lyžařských středisek a dalších sportovních zařízení. V posledních letech se stále více lidí zajímá o ekoturistiku, a tak se nabízí možnost podniknout pěší túru nebo cyklistický výlet a objevovat krásy evropské přírody.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E je jedním z nejlepších míst pro cestování, nabízí mnoho možností pro každého cestovatele. Díky rozmanitosti kontinentu si každý najde to svoje, co ho zaujme. Záleží pouze na vás, zda si zvolíte kulturní zážitky, přírodní krásy, sportovní aktivity nebo si jen tak užijete místní kuchyni a pohodu.\u003C\u002Fp\u003E",date_create:s,date_update:s,author_create:t,author_update:t}],seo_tags:[],created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2024-03-04T19:48:06.634661+00:00",name_original:"Europe",setting_top:d,setting_status_public:e}]}],fetch:{"OrganismsoPlaceTeaserListComponent:0":{_error:{type:"system",errno:u,code:u,erroredSysCall:"write",message:"request to https:\u002F\u002Fapi.frytolnacestach.cz\u002Fapi\u002Fplaces-regions-id-state\u002F110 failed, reason: write EPROTO 4771137024:error:1408F10B:SSL routines:ssl3_get_record:wrong version number:..\u002Fdeps\u002Fopenssl\u002Fopenssl\u002Fssl\u002Frecord\u002Fssl3_record.c:332:\n",statusCode:500}},"OrganismsoSidebarEventComponent:0":{events:[],images:a,imageSizesMedia:[{mediaQueriesWidth:a,elementWidth:0}],imageSizes:[{elementWidth:v,imageWidth:v,orientation:"s-"}]}},mutations:[]}}(null,"05-2023","04-2021",true,1,4,273,110,"booking","Itálie","italie",1.5,2,"118","0.3%","12-2023","state",3,"2024-02-07","1","EPROTO",100)));